function guardar() {

    var cmb = $('#cmb_campana option:selected').val();
    var name = $('#nombre').val();
    var id = $('#hide_id').val();
    var dataXml = $('.build-wrap').formBuilder("getData", "xml");
    var dataJson = $('.build-wrap').formBuilder("getData", "json");

    console.log(dataJson);

    if (name == '') {
        toastr.error('Ingrese Nombre del Formulario');
        return false;
    }
    if (cmb == 0) {
        toastr.error('Seleccione Campa√±a');
        return false;
    }

    $.ajax({
        type: 'POST',
        url: '/save_form',
        data: {campana_id: cmb, txt_nombre: name, html: dataXml, json: dataJson, hide_id: id},
        beforeSend: function () {
            $('#div_mensajes').removeClass('d-none');
            $('#div_mensajes').addClass('text-center');
            $('#mensajes').html('<img src="../images/load.gif" width="10%" height="10%" />');
        },
        success: function (data) {
            var d = JSON.parse(data);
            $('#div_mensajes').removeClass('d-none text-center')
            if (d['msg'] == 'error') {
                toastr.error(d['data']);
            } else {
                toastr.success(d['data']);
                clear_data();
                view_table();
            }
        },
        error: function (xhr) { // if error occured
            toastr.error('Error: '.xhr.statusText + xhr.responseText);
        },
        complete: function () {
            $('#div_mensajes').addClass('d-none');
        },
        dataType: 'html'
    });
}
